import React from 'react'
import { useSearchParams } from 'react-router-dom';
const place_order = ({product}) => {
    if (!product) {
        return null;
      }
  return (
    <div key={product.id}>
      <img src={product.image.url}/>
          <h2>{product.name}</h2>
          <span>{product.price}</span>
    </div>

  )
}

export default place_order
